import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Layout from './components/Layout';
import HomePage from './pages/HomePage';
import ManageInventoryPage from './pages/ManageInventoryPage';
import AboutUsPage from './pages/AboutUsPage';
import FoodSheltersPage from './pages/FoodSheltersPage';

const App = () => {
  return (
    <Router>
      <Layout>
          <Route exact path="/" component={HomePage} />
          <Route path="/manage-inventory" component={ManageInventoryPage} />
          <Route path="/about-us" component={AboutUsPage} />
          <Route path="/food-shelters" component={FoodSheltersPage} />
      </Layout>
    </Router>
  );
};

export default App;
